import React from 'react'
import {Button} from '../ButtonElement';
import {
    ServiceContainer,
    ServiceWrper,
    ServiceRw,
    // ImageWrp,
    Column1,
    Column2,
    TopLine,
    Heading,
    Subtitle,
    ButnWrp,
    Textwrper2,
    Textwrper,
    
} from './ServiceElements';

// import ServiceBG from '../../images/underwater.jpg';


const Services = () => {
    return (
        <>
            <ServiceContainer>
                <ServiceWrper>
                    <ServiceRw>
                        {/* <ImageWrp>
                            <Img src={ServiceBG}/>
                        </ImageWrp> */}
                        <Column1>
                            <Textwrper2>
                                {/* <TopLine>Top Line</TopLine> */}
                                <Heading>Values</Heading>
                                <Subtitle>if user logged in then the values appears</Subtitle>
                            </Textwrper2>
                        </Column1>
                        <Column2>
                            <Textwrper>
                                
                                <div className='slideshow'>
                                    <div className='slideshowsliders' style={{transform:`translate3d(${-index*100}%, 0, 0)`}}>
                                        {Content.map((block,index) => (
                                            <div className='slide' key={index} style={{block}}>
                                                <h1>{block.title}</h1>
                                                <p>{block.description}</p>
                                            </div>
                                        ))}
                                    </div>
                                    <div className='slideshowdots'>
                                        {Content.map((_,idx) => (
                                            <div key={idx} 
                                            className={`slideshowdot ${index === idx ? "active":""}`}
                                            onClick ={() => {
                                                setIndex(idx);
                                            }}
                                            ></div>
                                        ))}
                                    </div>
                                </div>

                                <TopLine>Top Line</TopLine>
                                <ButnWrp>
                                    <Button to='signup'>SIGN UP</Button>
                                </ButnWrp>
                            </Textwrper>
                        </Column2>
                    </ServiceRw>
                </ServiceWrper>
            </ServiceContainer>
        </>
    )
}

export default Services
